USE graduate_db;

DROP TABLE IF EXISTS messages;
CREATE TABLE messages(
	id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
	date_of_publication DATETIME NOT NULL,
	id_type_of_debtor INT UNSIGNED NOT NULL,
	id_of_debtor INT UNSIGNED NOT NULL,
	id_of_bancrupcy_manager INT UNSIGNED NOT NULL,
	id_type_of_message INT UNSIGNED NOT NULL,
	message_body VARCHAR(2000)
);





SELECT * FROM messages LIMIT 10;
UPDATE messages SET date_of_publication =
 MAKEDATE(
 	FLOOR(2000 + RAND() * 20),
 	FLOOR(1 + RAND() * 365)
 );